import React from 'react';
import { HashRouter, Route, Switch } from 'react-router-dom';

import Home from ''

class App extends React.Component {
  render() {
    return (
      <HashRouter>
        <Switch>
          <Route path="/" exact component={Home} />
        </Switch>
      </HashRouter>
    )
  }
}

export default App;
